 * 
 * ShoppingItemModel class 
 */

class ShoppingItemModel{

    constructor(shoppingItem){
        this.itemId = shoppingItem.itemId;
        this.itemName = shoppingItem.itemName;
        this.itemBrand = shoppingItem.itemBrand;
        this.itemQuantity = shoppingItem.itemQuantity;
    }

}

export default ShoppingItemModel;
